import { Link } from 'react-router-dom';
import { FaBars, FaHouseUser } from "react-icons/fa";
import { RiAppsLine } from "react-icons/ri";
import { GiOfficeChair } from "react-icons/gi";
import { CssBaseline } from "@mui/material";
import classes from './pages/Root.module.css';
import { Login } from "./pages/Login";
import { Signup } from "./pages/Signup";
import { Forgotpassword } from "./pages/Forgotpassword"
import { Home } from "./pages/Home";
import { Yourbooking } from "./pages/Yourbooking";
import { Selectnewbooking } from "./pages/Selectnewbooking";
import { Seatbooking } from "./pages/Seatbooking";
import { Parkingseat } from "./pages/Parkingseat";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { Final } from "./pages/Final";

function Sidebar() {
  return(
    <div className={classes.sidebar}>
        <nav>
          <ul className={classes.list}>
            <li>
              <Link to="/home"><FaHouseUser size={30} /></Link>
            </li>
            <li>
              <Link to="/yourbooking"><RiAppsLine size={30} /></Link>
            </li>
            <li>
              <Link to="/selectnewbooking"><GiOfficeChair size={30}/></Link>
            </li>
            <li>
              <Link to="/More"><FaBars size={30}/></Link>
            </li>
          </ul>
        </nav>
    </div>
  );
}

function RootLayout() {
  return (
    <>
      <Sidebar />
      <main className={classes.content}>
        <Routes>
          <Route path="/home" element={<Home />} />
          <Route path="/yourbooking" element={<Yourbooking />} /> 
          <Route path="/selectnewbooking" element={<Selectnewbooking />} />
          <Route path="/seatbooking" element={<Seatbooking />} /> 
          <Route path="/parkingseat" element={<Parkingseat />} /> 
          <Route path="/Final/:selected/:totalprice" element={<Final />} />
        </Routes>
      </main>
    </>
  );
}

function App() {
  return (
    <div>
        <CssBaseline />
          <Routes>
            <Route path="/" element={<Login />} />
            <Route path="/signup" element={<Signup />} />
            <Route path="/forgotpassword" element={<Forgotpassword />} />
            <Route path="/*" element={<RootLayout />} />
          </Routes>
    </div>
  );
}

export default App;
